import React from "react";

const ProductsPage = () => {
  return (
    <div>
      <h1>My Products Page</h1>

      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </div>
  );
};

export default ProductsPage;
